def getMaxNumOfDetailResponse(db,cursor):
    sql = "SELECT MAX(id) FROM `detailresponse_us` order by id desc limit 1"
    cursor.execute(sql)
    db.commit()
    num = cursor.fetchall()[0]["MAX(id)"]
    return num

